import { BrowserRouter, Route, Routes } from "react-router-dom";

import Footer from "./components/Footer";
import Home from "./pages/Home";
import React from "react";

function App() {
	return (
		<React.Fragment>
			<BrowserRouter>
				<Routes>
					<Route exact path="/" element={<Home />} />
				</Routes>
			</BrowserRouter>
			<Footer />
		</React.Fragment>
	);
}

export default App;
